import React from 'react';
import Card from './Card';

function CardList({ pets, images }) {

	const items = [];

	pets.map((pet, i) => {
		item.push(<Card key={pets[i].id} img={pets[i].img} name={pets[i].name} description={pets[i].description}/>);
	})

	return (
		<div>
			{items}
		</div>
	);
}

export default CardList;

